import { createApp } from 'vue';
import App from './App.vue';
import Vue from 'vue';
import VueRouter from 'vue-router';
import TheCharacter from './components/TheCharacter.vue';
import TheLocation from './component/'

Vue.use(VueRouter);
const routes = [
 { path: '/the-character', component: TheCharacter},
 { path: '/the-location', component: TheLocation},
];

const router = new VueRouter ({
    routes
});
new Vue({
    el: '#app',
    router,
    render: h =>(App)
});
createApp(App).mount('#app')
